/** @format */
import React from "react";

const Form = () => {
   return (
      <div>
         <form>
            <table bgcolor='lightblue' width='800'>
               <thead>summary='Add New Activity' </thead>
               <caption bgcolor='darkblue'>ADD NEW ACTIVITY</caption>
               <tr bgcolor='lightblue'>
                  <td>
                     <label for='name' size='15'>
                        Activity Name:{" "}
                     </label>
                  </td>
                  <td>
                     <input
                        size='25'
                        type='text'
                        placeholder='Type the name of the country'></input>
                  </td>
               </tr>
               <br />
            </table>
            <hr />
            <button>CREAR</button>
         </form>
      </div>
   );
};

export default Form;
